import { Link } from "react-router-dom";

const Navbar = () => {
  return (
    <header>
      <div className="container">
        <Link to="/">
          <FontAwesomeIcon icon="fa-solid fa-dumbbell" />
          <h2>Workout Buddy</h2>
        </Link>
      </div>
    </header>
  );
};

export default Navbar;
